import React from 'react';
import './p2.css'
import x from './Akpr.jpg'

export default function P2() {
  return (
    <div  className='x'>

      <div className='image'>
        
      </div>

        <div className='box'>
        <p className='content'>About Us : We as a company individuals work for the outsourcing companies , where we can put all our efforts to get their work done.
        AK is the collaboration effect of a group  to achieve a common goal or to complete a task in the most effective and efficient way. This concept is seen within the greater framework of a team, which is a group of interdependent individuals who work together towards a common goal</p>
        </div>

      </div>
  )
}
